import React, {Component} from 'react';
import "./Counter.css"
class Counter extends Component{
    constructor(){
        super();
        this.state = {
            counter : 0
        }
    }
  
    render(){
        return (
        <div className="Counter">
            <h1>Counter</h1>
            <button onClick={this.increment}>+1</button>
            <span className="Result"></span>
        </div>
        );
    }

    increment(){
        console.log("yaya")
    }
}



export default Counter;
